import React, {useEffect} from "react";
import "./App.css";
import WorkoutCard from "./WorkoutCard"


function WorkoutList ( { selectedPlayer, athletes, onLogSubmit, workouts } ) {


    const workoutsToDisplay = workouts.map((workout) => <WorkoutCard onLogSubmit={onLogSubmit} key={workout.id} workout={workout} athletes={athletes} athlete={selectedPlayer}/>)

    return (
        <div id="workout_list">
            {workoutsToDisplay}
        </div>
    )
}

export default WorkoutList
